import React from 'react';

const Index = (props) => {
    return (
        <>
            <div className={props.className} >
                <span className={props.spanclass}>{props.link}</span>
                <h2>{ props.title }</h2>
                {props.subTitle ? (<p>{ props.subTitle }</p>) : ''}
                {props.img ?
                     (<img src={props.img} width="600" height="360" /> ) :''}

            </div>
        </>
    );
}

export default Index;
